import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

export default function Order({ firstName, lastName, items, phone, zipCode, city, email, address }) {
    return (
        <View style={styles.order}>
            <Text>Zamówienie: {items}</Text>
            <Text>Imię: {firstName}</Text>
            <Text>Nazwisko: {lastName}</Text>
            <Text>Email: {email}</Text>
            <Text>Miasto: {city}</Text>
            <Text>Numer tel: {phone}</Text>
            <Text>Kod poczt: {zipCode}</Text>
            <Text>Ulica i numer: {address}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    order: {
        backgroundColor: 'gray',
        borderWidth: 1,
        borderStyle: 'solid',
        borderColor: 'black',
        margin: 10,
        padding: 10
    }
});
